import React, {useState, useRef, useEffect} from 'react';
import { Image, Button, StatusBar, View, Text } from '../lib/react-native';
import { defaultNavigationOptions } from '../lib/navigation';
import {ViewPager} from '../lib/viewpager';
import Touch from './Touch';
import {redux} from '../store';
import styles from '../styles';

const css = styles('HowDoesItWork');

const HowDoesItWork = ({navigation}) => {

	const [active, setActive] = useState(redux.get('click_header')? 4:0);
	const [isFin, setIfin] = useState(false);
	const ref = useRef(null);

	const data = [
		{
			title:'Configuración',
			description:'Desde el modulo Mis Cuentas Bancarias, podrás agregar los bancos que desees usar con nuestra app, selecciona de tus cuentas cual usar para pagar o recibir pagos, la app se adecua según tu configuración',
			image:'data:image/png;base64,',
		},
		{
			title:'Pagar con Qr',
			description:'Puedes realizar pagos, tomando lectura de códigos emitidos desde nuestra app que estén usando terceras personas',
			image:'data:image/png;base64,',
		},
		{
			title:'Recibir Pagos con Qr',
			description:'Simple como indicar el monto a recibir y esperar que un tercero haga lectura de tu Qr y emita el pago.',
			image:'data:image/png;base64,',
		},
		{
			title:'Pago Remoto',
			description:'Agrega una cuenta "Link" proporcionada por un tercero o indica los datos solicitados en nuestra app y emite un pago, así de simple es nuestra app...',
			image:'data:image/png;base64,',
		},
		/*
		{
			title:'Recompensa Publicitaria',
			description:'Acumular puntos viendo publicidad es la manera compensar el desarrollo de esta app, por cada publicidad sumas un 1 punto, cada modulo tiene publicidad que también suma puntas y son usados para los pagos con qr o pagos remotos...',
			image:'data:image/png;base64,',
		},
		*/
	];
	const fin = (data.length-1);
	
	if(!isFin && active===fin){
		setIfin(true);
	}

	useEffect(() => {
	    redux.push('help', true, true);
		redux.push('click_header', false);
	});

  	return (
    <View style={{ flex: 1 }}>
    	<StatusBar barStyle="dark-content" androidStatusBarColor="#FFFFFF" backgroundColor={"rgba(255,255,255, 1)"}
	    hidden={false} animated={true} translucent={false}
	  />
      <ViewPager ref={ref} initialPage={active} style={css.viewPager} onPageSelected={e=>setActive( e.nativeEvent.position)}>
      	{data.map((item, key)=>
      		<View style={css.page} key={key}>
			<Image  style={css['image'+key]} source={{uri: item.image}}/>
			<Text style={css.configuration}>{item.title}</Text>
			<Text style={css.description}>{item.description}</Text>
        </View>
        )}  
      </ViewPager>
 		<View style={css.footer}>
	 		<View style={css.circle}>
	 			{data.map((item, key)=> <View key={key} style={css[active===key?'circleActive': 'circleItem']}></View>)}
			</View>
	 		<View style={css.bottom}>
				<Touch style={css.touch} onPress={()=>active===fin?navigation.goBack() : ref.current.setPage(active + 1)}>
		        	<Text style={css.touchText}>{active===fin?"Finalizar":"Siguiente"}</Text>
		        </Touch>
			</View>
		</View>
    </View>
  );
};

export default {
	screen: HowDoesItWork,
	path: 'HowDoesItWork/:name',
	navigationOptions: ({ navigation }) => ({
	  headerStyle:{
	  	backgroundColor: 'white',
	  	elevation:0
	  },
	   headerTintColor: 'black',
	}),
}